import React from 'react';
import axios from 'axios';

class Clothes extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
        lat: 51.4939446,
        lon: -0.0841836,
        temp: null,
        weather: null,
        locationName: "Clothes"
    };
  }

  componentDidMount() {
    this.getClothesTotals();
  }

  getClothesTotals() {
    let items = []
    let jumper = 0
    let hoodie = 0
    let jacket = 0
    let sweater = 0
    let blazer = 0
    let raincoat = 0
    axios.get(`https://therapy-box.co.uk/hackathon/clothing-api.php?username=swapnil`)
    .then((response) => {
        // response.data.payload.map((item) => 
        // !items.includes(item.clothe) ?
        // items.push(item.clothe) : null
        // );
        // console.log(items)
        jacket = response.data.payload.reduce(function (n, person) {
            return n + (person.clothe == 'jacket');
        }, 0);
        console.log(jacket);
    })
  }

  render() {
    // console.log("duff", this.state);
    return (
      <h1>{this.state.locationName}</h1>
    );
  }
}

export default Clothes;
